import { Button } from '@material-ui/core'
import { lightGreen } from '@material-ui/core/colors';
import { Add, CenterFocusStrong } from "@mui/icons-material"
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Stack from '@mui/material/Stack';
import React from 'react'

const theme = createTheme({
    palette: {
      success: {
        // Purple and green play nicely together.
        main: '#2e7d32',
        light: '#4caf50',
        dark: '#1b5e20',
        contrastText: '#fff',
      },
      error: {
        // This is green.A700 as hex.
        main: '#f44336',
      },
      wurst: {
        // Purple and green play nicely together.
        main: '#2e7d32',
        light: '#4caf50',
        dark: '#1b5e20',
        contrastText: '#fff',
      },
    },
  });

export default function UpdateUserIndication() {
    return (
        <ThemeProvider theme={theme}>
        <Stack color="" direction="row" spacing={2} margin={4}>
        <Button theme={theme} color="wurst" variant="contained" >
          Success
        </Button>
        <Button theme={theme} variant="outlined" color="error">
          Error
        </Button>
      </Stack>
      </ThemeProvider>
    )
}
